import React from 'react';
import {Swiper,SwiperSlide} from 'swiper/react';
import {useState,useEffect} from 'react'
import axios from 'axios'
import './css/testimonial.css'
import SwiperCore, { EffectCoverflow } from 'swiper';
import 'swiper/swiper-bundle.css';

import { VscChevronLeft, VscChevronRight} from "react-icons/vsc"
SwiperCore.use([EffectCoverflow]);



function Testimonial(){
    const[data,setData]=useState([]);
    useEffect(()=>{
        axios.get( "/api-auth/testomonial/")
        .then(res=>{
          console.log(res)
          setData(res.data)
        })
        .catch(err=>{
          console.log(err)
        })

    })
   return (
    <Swiper   
    autoplay="100"  
  
    effect="coverflow"
    slidesPerView='auto'
    centeredSlides='true'
    >
   {data.map(data=>(
   
    <SwiperSlide  style={{width:"20rem",height:"23rem",}} >
     
             <div style={{width:"20rem",height:"23rem",boxShadow:" 1px 1px 5px gray",marginBottom:"1rem",backgroundColor:"silver"}}>
             <img src={data.image} style={{width:"10rem",height:"10rem",left:"27%",top:"6%",position:"absolute",borderRadius:"50%"}}/>
             <div style={{position:"absolute",height:"7rem",width:"12rem",top:"50%",left:"25%",fontWeight:"600"}}>
                 <p><VscChevronLeft style={{color:"white",fontSize:"20px"}}/>{data.message}<VscChevronRight style={{color:"white",fontSize:"20px"}}/></p>
             </div>
             </div>
     
       
        
    </SwiperSlide>   ))}
  
    

  </Swiper>
      
    )
       
   
}

export default Testimonial;
